    useEffect(() => {
        console.log("first", user)
    }, [])

    useEffect(() => {
        console.log("counter alterado")
    }, [user])

    return (
        <div>
            <h1>User : {user.userName}</h1><br />
            <Link href="/"><a>Home</a></Link><br />
        </div>
    )
}

export default User
